import axios from 'axios';
import React from 'react';
import { useEffect } from 'react';
import InputFilters from './InputFilters';

const getElemonItem = (pageNumber = 1, pageSize = 20, priceMode, baseCardId, tokenId, rarities, classes, purities) => {
    return axios.get(`https://app.elemon.io/market/getBnbPrice`).then(res => console.log(res.data), {
        headers: {
            "Access-Control-Allow-Origin": "*"
        }
    });

}
const getElemonInfo = () => {

}

const Elemon = () => {

    useEffect(() => {
        getElemonItem();
    })
    return (
        <div>
            <InputFilters />
        </div>
    );
};

export default Elemon;
